import React, { Component } from 'react';
import styles from './Navigation.module.css';

class MainNavigation extends Component {
    constructor(props) {
        super(props);
        this.state = {  };
    }

    render() {
        return (
            <div className={styles.wrap}>
                <a>News</a>
                <a>Teams</a>
                <a>Standing</a>
            </div>
        );
    }
}

export default MainNavigation;
